    const response = await fetch("https://fakestoreapi.com/products");
    const data = await response.json();
    setProducts(data);
    console.log(data)
    };
    fetchProducts();
}, []);


    return(
        <ul className="productPageContainer wrapper">
            {
                (products.map((dataObject)=>{
                    return(
                    <li key={dataObject.id}>
                        <SingleProduct productData={dataObject}/>
                    </li> 
